    return (
        <header className="bg-indigo-600 h-16">
            <div className="flex justify-between">
                <div>
                <a href="#" className="">Home</a>
                </div>
                
                <a href="#" className="">About me</a>
                <a href="#" className="">Skills</a>
                <a href="#" className="">Projects</a>
